import {Link, usenNavigate} from 'react-router-dom';
const Home =(props)=>{

    const navigate = usenNavigate();
    const goAbout =()=>{
        navigate("/about")
    }
    return(
        <>
            <p>THIS IS HOME!</p>
            <p><Link to={"/"}>HOME</Link></p>
            <p><Link to={"/about"}>ABOUT</Link></p>
        </>
    );
}
export default Home;
